import { useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.css";

function Products() {
    const [theProducts, setTheProducts] = useState([]);

    useEffect(() => {
        // Read the data of robots from the database:
        fetch("http://localhost:8081/listProducts")
            .then(response => response.json())
            .then(products => setTheProducts(products));

    }, []); // the empty brackets here means that useEffect() will only run on the first render

    // fetches one robot that matches the input in the search bar
    function getInputProduct() {
        // Fetch the value from the input field
        let id = document.getElementById("deleteRobotById").value;
        console.log(id);

        fetch(`http://localhost:8081/deleteRobot/${id}`, {
            method: 'DELETE',
            headers: { 'content-type': 'application/json' },
            body: JSON.stringify(
                { "id": id }
            )
        })
            .then(response => response.json())
            .then(deleteThisRobot => {
                deleteOneRobotById(deleteThisRobot);

                // update the catalog of robots to not show the deleted robot
                fetch("http://localhost:8081/listRobots")
                    .then(response => response.json())
                    .then(robots => {
                        loadRobots(robots);
                    })
            });

        // shows the robot that has been deleted from the database
        function deleteOneRobotById(deleteThisRobot) {
            var RobotCard = document.getElementById("col3");
            RobotCard.innerHTML = ""; //clear the HTML so there are no repeated robots

            let id = deleteThisRobot.id;
            let name = deleteThisRobot.name;
            let price = deleteThisRobot.price;
            let description = deleteThisRobot.description;
            let image = deleteThisRobot.imageUrl;

            let AddRobotCard = document.createElement("div");

            AddRobotCard.classList.add("col3");

            AddRobotCard.innerHTML = `
                <div class="card shadow-sm">
                    <h1>Robot Deleted</h1>
                    <img src=${image} class="card-img-top" alt=${name} width="250"></img>
                    <div class="card-body">
                        <p class="card-text"> ${id}. <strong>${name}</strong> $${price}</p>
                        <p>${description}</p>
                        <div class="d-flex justify-content-between align-items-center">
                        </div>
                    </div>
                </div>
                `;

            RobotCard.appendChild(AddRobotCard);

        }
    }

    const ShowProducts = () => {
        return (
            <div>
                <div className="container mt-3">
                    <div className="row">
                        {theProducts.map(product => ( // map reads the whole theProducts array element-by-element
                            <div key={product.id} className="col-12 col-sm-6 col-md-4 col-lg-3 mb-4">
                                <div className="card">
                                    <img src={product.image} className="card-img-top" alt={product.title} style={{ objectFit: 'cover', height: '200px' }} />
                                    <div className="card-body">
                                        <h5 className="card-title">{product.title}</h5>
                                        <p style={{ textAlign: "center", fontSize: "20px", color: "green" }}>${product.price}</p>
                                        <p className="card-text"><b>Description</b> - {product.description}</p>
                                        <p className="card-text"><b>Tag</b> - {product.category}</p>
                                        <p className="card-text"><b>Rating:</b> {product.rating.rate} from {product.rating.count} people</p>
                                    </div>
                                </div>
                            </div>
                        ))}
                    </div>
                    <div id="searchedProduct" class="row row-cols-1 row-cols-sm-2 row-cols-md-3 row-cols-lg-4 row-cols-lg-5 g-3"></div>
                </div>
                <br></br>
                <div>
                    <input type="number" id="inputProductName" placeholder="Enter Product ID"></input>
                    <button type="button" onClick={getInputProduct}>One Product</button>
                </div>
            </div>
        );
    };

    return (<div>
        <ShowProducts />
    </div>);
}

export default Products;
